ang sempit dan tersumbat.</span></div></div><div class="draft-block draft-block-unstyled draft-block-empty"><div class="public-DraftStyleDefault-block public-DraftStyleDefault-ltr"> </div></div><div class="draft-block draft-block-unstyled"><div class="public-DraftStyleDefault-block public-DraftStyleDefault-ltr"><strong><span style="color: #ffff00;" data-text="true">&#8211; Dada Terasa berat / Sesak &#8211;</span></strong></div></div><div class="draft-block draft-block-unstyled"><div class="public-DraftStyleDefault-block public-DraftStyleDefault-ltr"><span data-text="true">Gejala asma ini dapat membuat Anda semakin sulit bernapas dan terasa sakit setiap kali akan mengambil napas. Dada Anda mungkin terasa seperti ditekan atau ditindih dengan benda berat. Gejala batuk dan mengi juga dapat semakin memperburuk keadaan</span></div></div></div>
